# Text form of tensorflow.tfcompile.Config proto.
feed {
  id { node_name: "x_hold" }
  shape {
    dim { size: 2 }
    dim { size: 3 }
  }
}
feed {
  id { node_name: "y_hold" }
  shape {
    dim { size: 3 }
    dim { size: 2 }
  }
}
fetch {
  id { node_name: "x_y_prod" }
}

I don't see any operation defined for this. and in tf_library, we just pass the config file and define the class names. I don't understand where exactly does it specifies that the given operation associated with the graph is matmul.
